import react from '../../components/postcard/assets/';
import laravel from './assets/laravel.png';

const LandingView = () => {


    return (
        <>
        <Navbar />
        <div className={styles.__container_landing}>

            <div className={styles.__landing_title_div}>
            <h1>Esta es la Landing</h1>
            </div>

            <div className={styles.__main_landing}>
                    <PostCard logo="react"/>
                    <PostCard logo="laravel" />
